package SwitchAssigment;

public class HappyNewYear {

	public static void main(String[] args) 
	{
		// TODO Auto-generated method stub
		int code = 1;
		
		switch(code) {
		
		case 1:System.out.println("Wish");
		case 2:System.out.println("You");
		case 3:System.out.println("A");
		case 4:System.out.println("Very");
		case 5:System.out.println("Happy");
		case 6:System.out.println("New");
		default:System.out.println("Year");
		}


	}

}
